mixed-port: 7890
socks-port: 7891
allow-lan: false
mode: rule
log-level: info
ipv6: false
external-controller: 127.0.0.1:9090
secret: ''
interface-name: en0
enable-process: true
tcp-concurrent: true
keep-alive-interval: 30
find-process-mode: always
unified-delay: true
global-client-fingerprint: random
geodata-mode: true
geox-url:
  geoip: 'https://github.com/chocolate4u/Iran-v2ray-rules/releases/latest/download/geoip.dat'
  geosite: 'https://github.com/chocolate4u/Iran-v2ray-rules/releases/latest/download/geosite.dat'
  mmdb: 'https://github.com/chocolate4u/Iran-v2ray-rules/releases/latest/download/Country.mmdb'

# geo-auto-update: true
# geo-update-interval: 72
geodata-loader: memconservative
geosite-matcher: mph

profile:
  store-selected: false
  store-fake-ip: true

dns:
  enable: true
  listen: 0.0.0.0:1053
  ipv6: true
  prefer-h3: true
  use-hosts: true
  enhanced-mode: fake-ip
  fake-ip-range: 198.18.0.1/16
  default-nameserver:
  - 1.1.1.1
  - 9.9.9.9
  nameserver:
  - 'https://1.1.1.1/dns-query#QQOLI'
  - 'https://8.8.8.8/dns-query#QQOLI'
  - 'https://dns.quad9.net/dns-query#QQOLI'
  - 'https://mozilla.cloudflare-dns.com/dns-query#QQOLI&h3=true'
  fallback:
  - 'https://1.1.1.1/dns-query#QQOLI'
  - 'https://8.8.8.8/dns-query#QQOLI'
  - 'https://dns.quad9.net/dns-query#QQOLI'
  - 'https://mozilla.cloudflare-dns.com/dns-query#QQOLI&h3=true'
  fallback-filter:
    geoip: true
    geoip-code: IR

tun:
  enable: true
  stack: mixed
  dns-hijack:
  - 'any:53'
  - 'tcp://any:53'
  auto-route: true
  auto-detect-interface: true
  mtu: 9000
  strict-route: true
  #device: utun
  
proxy-providers:
  a:
    type: http
    url: "https://raw.githubusercontent.com/yebekhe/TVC/main/subscriptions/meta/mix"
    interval: 3600
    path: ./providers/a.yaml
    health-check:
      enable: true
      interval: 300
      url: http://www.gstatic.com/generate_204
      timeout: 3000
      lazzy: true
    override:
      skip-cert-verify: false
      udp: true
      ip-version: ipv4-prefer 
    exclude-type: "ss|http"
  b:
    type: http
    url: "https://raw.githubusercontent.com/MrMohebi/xray-proxy-grabber-telegram/master/collected-proxies/clash-meta/all.yaml"
    interval: 3600
    path: ./providers/b.yaml
    health-check:
      enable: true
      interval: 300
      url: http://www.gstatic.com/generate_204
      timeout: 3000
      lazzy: true
    override:
      skip-cert-verify: false
      udp: true
      ip-version: ipv4-prefer 
    exclude-type: "ss|http"

proxy-groups:
- name: MMOBI
  type: url-test
  url: http://www.gstatic.com/generate_204
  interval: 300
  tolerance: 50
  use:
  - a
  - b
- name: AALI
  type: select
  proxies:
  - MMOBI
  - DIRECT
  use:
  - a
  - b
- name: QQOLI
  type: select
  proxies:
  - AALI
  - MMOBI
  - TTAQI
  use:
  - a
  - b
- name: TTAQI
  type: select
  proxies:
  - DIRECT
  - AALI  
  - MMOBI
- name: MMAQI
  type: select
  proxies:
  - REJECT
  - DIRECT
- name: NNAQI
  type: select
  proxies:
  - AALI
  - TTAQI
  - MMOBI
  use:
  - a
  - b

